import React from 'react';
import './App.css';
import Home from './pages/Home'

function App() {
  return (
    <div className="App">
      <div>
      <Router>
    <Route path="/" component={Home}>
      <Route path="about" component={About} />
      <Route path="inbox" component={Inbox}>
        <Route path="messages/:id" component={Message} />
      </Route>
    </Route>
  </Router>
      </div>
    </div>
  );
}

export default App;
